import React from "react";
import Slider from "react-slick";
import "./Carousel.css"; // Per personalitzar estils

function VideoCarousel() {
    const videos = [
        {
            id: 1,
            title: "Wisconsin",
            videoUrl: "https://drive.google.com/file/d/1MF9pskvYNstpLSs_vHGEpdLKcZDiAxYS/preview",
        },
        {
            id: 2,
            title: "Wisconsin",
            videoUrl: "https://drive.google.com/file/d/1MF9pskvYNstpLSs_vHGEpdLKcZDiAxYS/preview",
        },
        {
            id: 3,
            title: "Wisconsin",
            videoUrl: "https://drive.google.com/file/d/1MF9pskvYNstpLSs_vHGEpdLKcZDiAxYS/preview",
        },
        {
            id: 4,
            title: "Wisconsin",
            videoUrl: "https://drive.google.com/file/d/1MF9pskvYNstpLSs_vHGEpdLKcZDiAxYS/preview",
        }
    ];

    const settings = {
        dots: false,
        infinite: true,
        speed: 500,
        slidesToShow: 3,
        slidesToScroll: 1,
        responsive: [
            {
                breakpoint: 1024,
                settings: { slidesToShow: 2 },
            },
            {
                breakpoint: 600,
                settings: { slidesToShow: 1 },
            },
        ],
    };

    return (
        <div className="carousel-container">
            <h2>Popular Videos</h2>
            <Slider {...settings}>
                {videos.map((video) => (
                    <div key={video.id} className="carousel-item">
                        <video
                            src={video.videoUrl}
                            controls
                            className="carousel-video"
                            preload="metadata"
                        ></video>
                        <h3 className="carousel-title">{video.title}</h3>
                    </div>
                ))}
            </Slider>
        </div>
    );
}

export default VideoCarousel;
